import React from "react";
import { Link } from 'react-router-dom';
import "./homepage.css";

function Homepage() {
    return (
        <div className="homepage">
            <Link to="test.html">
                <div className="window c1">
                    <img src={require("../public/musicPlayer/rain.jpg").default} alt="Image 1" />
                </div>
            </Link>
            <Link to="page2.html">
                <div className="window c2">
                    <img src={require("../public/play_music.jpg").default} alt="Image 2" />
                </div>
            </Link>

            <Link to="page3.html">
                <div className="window c3">
                    <img src={require("../public/admin.jpg").default} alt="Image 3" />
                </div>
            </Link>
        </div>
    );
}

export default Homepage;
